import React from "react";
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { useState } from "react";
import { Redirect } from "react-router-dom/cjs/react-router-dom.min";

export const Login = () => {
    const [statue, Setstatue] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const Handleclick = () => {
        if (email && password) {
            Setstatue('True');
        } else {
            Setstatue('False');
        }
    }

    if (statue === 'True') {
        return <Redirect to="/"/>;
    }
    if (statue === 'False') {
        return (
            <div className="login">
                <p>Remplir l'ensemble des donn√©es</p>
                <form onSubmit={Handleclick}>
                    <p></p>
                    <label htmlFor="email">Email</label><p></p>
                    <input value={email} onChange={(e) => setEmail(e.target.value)} type="email" placeholder="Email" /><p></p>
                    <label htmlFor="Password">Password</label><p></p>
                    <input value={password} onChange={(e) => setPassword(e.target.value)}type="password" placeholder="**********"/><p></p>
                    <button type="submit">Login</button>
                    <Link href="/register" underline="hover">
                        Don't have an account ?
                    </Link>
                </form>
            </div>
        );
    } else {
        return (
            <Container component="main">
                <Box component="form" onSubmit={Handleclick}>
                    <p></p>
                    <label htmlFor="email">Email</label><p></p>
                    <input value={email} onChange={(e) => setEmail(e.target.value)} type="email" placeholder="Email" /><p></p>
                    <label htmlFor="Password">Password</label><p></p>
                    <input value={password} onChange={(e) => setPassword(e.target.value)}type="password" placeholder="**********"/><p></p>
                    <button type="submit">Login</button>
                    <Link color="blue" href="/register">
                        Don't have an account ?
                    </Link>{' '}
                </Box>
            </Container>
        );
    }
}
